import { Link } from '@material-ui/core';
import React from 'react'
import { useEffect } from 'react';
import { useState } from 'react';

const initialValue = [
    {
        offset: 0,
        data: [],
        perPage: 5,
        currentPage: 0
    }
]

const Products = () => {

    const [users, setUsers] = useState([]);
    const [data, setData] = useState(initialValue);
    const [count, setCount] = useState(0);

    const getUsers = async () =>{
        try{
            const response = await fetch('https://api.github.com/users');
            setUsers(await response.json()); 
        }catch(error){
            console.log("my error"+error);
        }
    }

    useEffect(()=>{
        getUsers();
    },[]);

    const addItem = e => {
        setCount(count + 1)
    }

    const decItem = e => {
        setCount(count-1)
    }

    return (
        <div className="products">
            <div class="card-columns">
                {
                    users.map((Elm)=>{
                        return (
                            <div class="card-body text-center">
                               <div class="image"><img src={Elm.avatar_url} class="rounded" width="155"/></div>
                               <p class="card-text">Name</p>
                               <p class="card-text">Price</p>
                               <p class="card-text">item {count}</p>
                               <button class="btn btn-outline-primary mr-2" onClick={(e) => addItem(e)} >inc</button>
                               <button class="btn btn-outline-primary mr-2" onClick={(e) => decItem}>dec</button>
                            </div>
                        )
                    })
                }
            </div>
        </div>
    )
    }

export default Products
